script: |
  super -f text -I q13596.spq | sort > q13596.out

inputs:
  - name: q13596.spq
    data: |
      SELECT ALL - CAST ( - 20 AS INTEGER ) AS col0 FROM tab2 (FORMAT parquet) WHERE NULL NOT BETWEEN col2 / - col0 AND + col2 AND + CAST ( NULL AS INTEGER ) > - - col1 + - + 86 * + - col1;
  - name: tab2

outputs:
  - name: q13596.out
    data: |
